import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Find and click the cart element
    // Using a text-based selector that is robust to changes in the cart count
    const cartButton = page.locator('div.cart:has-text("Cart")');
    await cartButton.waitFor({ state: 'visible', timeout: 5000 });
    await cartButton.click();

    // Wait for the modal to become visible.
    // NOTE: The modal element #cartModal is not in the provided static HTML,
    // but is referenced by the provided JS and is assumed to be displayed upon clicking the cart.
    const modalLocator = page.locator('#cartModal');
    await modalLocator.waitFor({ state: 'visible', timeout: 5000 });

    // Take a screenshot of the open modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_modal_open.png'));

    // Verify the modal is open by checking for a key element within it
    const checkoutButton = modalLocator.locator('button.checkout-btn');
    const isCheckoutButtonVisible = await checkoutButton.isVisible();
    const checkoutButtonText = await checkoutButton.textContent();

    return {
      success: true,
      action: "Opened the shopping cart modal by clicking the cart icon.",
      extractedData: {
        isModalVisible: await modalLocator.isVisible(),
        isCheckoutButtonVisible: isCheckoutButtonVisible,
        checkoutButtonText: checkoutButtonText.trim()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // If the modal doesn't appear as expected, the test will fail here.
    return {
      success: false,
      action: "Failed to open shopping cart modal.",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
